/* eslint-disable arrow-body-style */
import React from 'react';
import styled from 'styled-components';

const SearchResultContainer = styled.div`
  height: 100%;
`;

const ResultItem = styled.div``;

const ResultItemFileName = styled.div``;

const ResultItemMatch = styled.div``;

const SearchResult = () => {
  return (
    <SearchResultContainer>
      <h3>Search results.</h3>
      <ResultItem>
        <ResultItemFileName>A.pdf</ResultItemFileName>
        <p>:</p>
        <ResultItemMatch>React,jquery</ResultItemMatch>
      </ResultItem>

      <ResultItem>
        <ResultItemFileName>Asw.pdf</ResultItemFileName>
        <p>:</p>
        <ResultItemMatch> jquery</ResultItemMatch>
      </ResultItem>
    </SearchResultContainer>
  );
};

export default SearchResult;
